  `description` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` int(11) NOT NULL COMMENT '0-inactive,1-active',
  `added_by` bigint(20) unsigned NOT NULL COMMENT 'from usertable',
